import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('ignore', () => {
    test('ok', async () => {
        const r1 = await request('https://enable1.w2.org');
        expect(r1.data.url).toBe('https://enable1.w2.org/');
        const r2 = await request('https://enable2.w2.org:5566');
        expect(r2.data.body).toBe('test');
        const r3 = await request('https://enable3.w2.org:5566');
        expect(r3.data.url).toBe('https://enable3.w2.org:5566/');
        const r4 = await request('https://enable4.w2.org:5566');
        expect(r4.data.body).toBe('test');
    });
});
